import subprocess
import sys
import threading
import signal

# متغير للتحقق من إغلاق الأداة
tool_closed = False

# معالجة إشارة الإنهاء وإغلاق الأداة بشكل صحيح
def handle_exit(signal, frame):
    global tool_closed
    tool_closed = True
    print("Tool closed")
    sys.exit(0)

# تعيين معالج إشارة الإنهاء
signal.signal(signal.SIGINT, handle_exit)

